import React from 'react'

export default function Footer() {
    return (
        <div className='flex justify-center'>
            <div className='w-[60vw] bg-slate-950 h-fit my-8 p-5'>
                <img src="https://cdn.animevietsub.biz/data/logo/logoz.png" alt="img" />
            </div>
        </div>
    )
}
